// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Market is ReentrancyGuard {
    using Counters for Counters.Counter;
    Counters.Counter private _listingCount;
    Counters.Counter private _offerCount;
    Counters.Counter private _saleCount;

    mapping(uint256 => Listing) public marketListings;
    mapping(uint256 => Offer) public offers;

    uint256 LISTING_PRICE = 0.01 ether;

    struct Offer {
        uint256 id;
        address userAddress;
        uint256 price;
        address nftContractAdd;
        uint256 tokenId;
        bool fulfilled;
        bool cancelled;
    }

    struct Listing {
        uint256 listingId;
        address nftContractAdd;
        uint256 tokenId;
        address ownerAdd;
        uint256 price;
        bool isSold;
        bool isCancelled;
    }

    constructor() payable {
        _listingCount.increment(); // start from 1
        _offerCount.increment(); // start from 1
    }

    function putOnSale(
        address _nftContract,
        uint256 _tokenId,
        uint256 _price
    ) public payable nonReentrant {
        ERC721 nft = ERC721(_nftContract);
        address tokenOwner = nft.ownerOf(_tokenId);
        require(msg.sender == tokenOwner, "Only token owner can do this.");
        require(msg.value == LISTING_PRICE, "Listing fee must be sent");

        nft.transferFrom(msg.sender, address(this), _tokenId);

        uint256 itemId = _listingCount.current();
        marketListings[itemId] = Listing(
            itemId,
            _nftContract,
            _tokenId,
            payable(msg.sender),
            _price,
            false,
            false
        );
        _listingCount.increment();

        emit ListingCreated(itemId, msg.sender, _nftContract, _tokenId, _price);
    }

    function cancelSale(uint256 listingId) public nonReentrant {
        Listing storage listing = marketListings[listingId];

        require(msg.sender == listing.ownerAdd, "Only owner can do this action");
        require(!listing.isSold, "Item has been already sold.");
        require(!listing.isCancelled, "Listing already cancelled.");

        listing.isCancelled = true;

        IERC721(address(listing.nftContractAdd)).transferFrom(address(this), msg.sender, listing.tokenId);

        emit ListingCancelled(listing.listingId, listing.ownerAdd, listing.nftContractAdd, listing.tokenId);
    }

    function buyNFT(uint listingId) public payable nonReentrant {
        Listing storage listing = marketListings[listingId];
        require(listing.nftContractAdd != address(0x0), "Listing not found");

        if(listing.isSold) {
            revert("Item is already sold");
        } else if (listing.isCancelled) {
            revert("This listing is cancelled");
        }

        require(msg.value >= listing.price, "You have to send this listing's price");
        
        listing.isSold = true;
        payable(address(listing.ownerAdd)).transfer(listing.price);
        ERC721(listing.nftContractAdd).transferFrom(address(this), msg.sender, listing.tokenId);

        emit ItemSold(_saleCount.current(), listing.ownerAdd, msg.sender, listing.price);
    }

    function placeBid(address _nftContractAdd, uint256 _tokenId, uint256 _price) public {
        IERC721 nft = IERC721(_nftContractAdd);
        address tokenOwner = nft.ownerOf(_tokenId);
        if(tokenOwner == address(this)) {
            Listing memory listing = _getListedItem(_nftContractAdd, _tokenId);
            tokenOwner = listing.ownerAdd;
        }
        require(msg.sender != tokenOwner, "You are owner of this token");

        // @dev First, set WETH allowance for this market contract using WETH contract.
        IERC20 weth = IERC20(address(0xc778417E063141139Fce010982780140Aa0cD5Ab));
        uint256 allowance = weth.allowance(msg.sender, address(this));
        require(allowance >= _price, "WETH allowance is not enough");

        uint256 currentOffer = _offerCount.current();
        _offerCount.increment();
        offers[currentOffer] = Offer(
            currentOffer,
            msg.sender,
            _price,
            _nftContractAdd,
            _tokenId,
            false,
            false
        );

        emit BidPlaced(currentOffer, msg.sender, _nftContractAdd, _tokenId, _price);
    }

    function acceptBid(uint _offerId) public nonReentrant {
        Offer storage offer = offers[_offerId];
        require(!offer.fulfilled, "Offer already fulfilled.");
        require(!offer.cancelled, "Offer cancelled.");

        IERC721 nftContract = IERC721(offer.nftContractAdd);
        address nftOwner = nftContract.ownerOf(offer.tokenId);

        /*
        * There are two cases of accepting an offer: 1- NFT was not listed 2- NFT was already listed
        * If the owner address equals the address of this contract, it means NFT already listed
        * In this case, we need to find in our `listings` mapping and adjust the actual owner...
        */
        if(nftOwner == address(this)){ //  Already listed
            Listing memory _listing = _getListedItem(offer.nftContractAdd, offer.tokenId);
            Listing storage listing = marketListings[_listing.listingId];
            nftOwner = listing.ownerAdd;

            require(msg.sender == nftOwner, "Only owner can do this");
            require(listing.isSold != true, "Item already sold");
            
            IERC20 weth = IERC20(address(0xc778417E063141139Fce010982780140Aa0cD5Ab));
            weth.transferFrom(address(offer.userAddress), payable(msg.sender), offer.price);
            nftContract.transferFrom(address(this), offer.userAddress, offer.tokenId);

            listing.isSold = true;
            uint256 currentSale = _saleCount.current();
            _saleCount.increment();

            emit ItemSold(currentSale, msg.sender, offer.userAddress, offer.price);
        } else {
            require(msg.sender == nftOwner, "Only owner can do this");
            
            // If the MarketContract is not approved for this token, it will throw an error. So the rest of the code won't work
            nftContract.transferFrom(msg.sender, offer.userAddress, offer.tokenId);

            IERC20 weth = IERC20(address(0xc778417E063141139Fce010982780140Aa0cD5Ab));
            weth.transferFrom(address(offer.userAddress), payable(msg.sender), offer.price);

            uint256 currentSale = _saleCount.current();
            _saleCount.increment();
            
            emit ItemSold(currentSale, msg.sender, offer.userAddress, offer.price);
        }
    }

    function cancelBid(uint _offerId) public nonReentrant {
        Offer storage offer = offers[_offerId];
        require(msg.sender == offer.userAddress, "Only owner can do this.");
        require(!offer.fulfilled, "Offer already fulfilled.");
        require(!offer.cancelled, "Offer cancelled.");

        offer.cancelled = true;
        emit BidPlaced(_offerId, msg.sender, offer.nftContractAdd, offer.tokenId, offer.price);
    }

    function _getListedItem(address _nftContractAddress, uint256 _tokenId)
        public
        view
        returns (Listing memory item)
    {
        require(_nftContractAddress != address(0x0), "0 address");

        for (uint256 i = 0; i <= _listingCount.current(); i++) {
            if (
                marketListings[i].nftContractAdd == _nftContractAddress &&
                marketListings[i].tokenId == _tokenId &&
                !marketListings[i].isSold &&
                !marketListings[i].isCancelled
            ) {
                return marketListings[i];
            }
        }

        revert("Listing not found");
    }

    /**
     * Since we're not using a proxy or sth like that in this version of contract, we transfer listed items to Market contract.
     * So, listed items won't be in the wallet of user.
     * We need to get listed items of user in the application
     *
     * Maybe we can implement a proxy in the future... :O
     */
    function getListedItemsOf(address userAddress) public {}

    receive() external payable {}

    fallback() external payable {}

    event ListingCreated(
        uint256 indexed listingId,
        address indexed owner,
        address indexed nftContract,
        uint256 tokenId,
        uint256 price
    );

    event ListingCancelled(
        uint256 indexed listingId,
        address indexed owner,
        address indexed nftContract,
        uint256 tokenId
    );

    event BidPlaced(
        uint256 bidId,
        address indexed bidder,
        address indexed nftContractAdd,
        uint256 indexed tokenId,
        uint256 price
    );

    event BidCancelled(
        uint256 indexed bidId,
        address indexed bidder,
        address indexed nftContractAdd,
        uint256 tokenId,
        uint256 price
    );

    event ItemSold(
        uint256 indexed saleCount,
        address indexed seller,
        address indexed buyer,
        uint256 price
    );
}
